result:
.form-box {
    width: 400px;
}

.form-box .line {
    text-align: center;
}

.red {
    color: #ff0000;
}
.el-time-panel__content::after,
.el-time-panel__content::before {
    margin-top: -7px;
}

.el-time-spinner__wrapper .el-scrollbar__wrap:not(.el-scrollbar__wrap--hidden-default) {
    padding-bottom: 0;
}

.containert {
    padding: 30px;
    background: #fff;
    border: 1px solid #ddd;
    border-radius: 5px;
    display: flex;
    direction:vertical;
}

.handle-box {
    margin-bottom: 20px;
}
.error-page{
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    width: 120%;
    height: 100%;

    box-sizing: border-box;
}
.error-code{
    line-height: 1;
    font-size: 250px;
    margin-right: 160px;
    font-weight: bolder;
    color: #f02d2d;
}
.error-code span{
    color: #00a854;
}
.error-desc{
    font-size: 30px;
    color: #777;

}
